import * as React from 'react';
import { FC, MouseEventHandler } from 'react';
import { ButtonType } from '../../../shared/enums';

import * as classes from './Button.module.scss';

interface Props {
    type: ButtonType,
    disabled?: boolean,
    clicked?: MouseEventHandler
};

